#define $INFO	'curframe.Trace'
initialize()=
declare
	map		= BitmapObject default null;
	lbo		= LongByteObject;
	x		= integer not null;
	y		= integer not null;
	res		= FloatObject;
	AtoP	= Float not null;
enddeclare
{
	field(mapfld).BgBitmap = field(mapfld).BgBitmap.Duplicate();
	map = field(mapfld).BgBitmap;

	/*
	**	Get the screen resolution (pixels per 1/1000 inch)
	*/
	curframe.TopForm.FetchTaggedValue(
		tag='system_info#resolution', item=Byref(res));
	AtoP = res.Value;
}


on childclickpoint =
{
	/*
	**	Paint previously-filled county yellow
	*/
	if x != 0 then
		map.FillBitmap(x=x, y=y, replacementcolor=RGB(red=255,green=255,blue=0));
	endif;

	/*
	**	Get the pixel location of the click
	*/
	x = curframe.Xstart*AtoP;
	y = curframe.Ystart*AtoP;

	/*
	** Fill the clicked county with red, and capture the boundary coordinates
	*/
	map.FillBitmap(x=x, y=y, replacementcolor=255, range=80, bounds=Byref(lbo));

	/*
	**	Refresh the map, so the colour changes display 
	*/
	field(mapfld).BgBitmap = null;
	field(mapfld).UpdBackground();
	curframe.SendUserEvent('refresh');
}

on userevent 'refresh' =
{
	field(mapfld).BgBitmap = map;
	field(mapfld).UpdBackground();

	/*
	**	Show the boundary length (number of contiguous pixels) in the trace window
	*/
	$INFO('lbo length is ' + varchar(lbo.length));
}

